    const[cust, setcust] = useState(false)


    const submitresponse = (event) =>{
        console.log(credentials.type)
        axios.post("http://localhost:9087/authenticate", credentials)
            .then(response => {
                console.log(response)
                console.log(response.data)
                console.log(credentials.type)
                console.log(response.data !== "")
            }).catch(error=>{
            console.log(error)
        })
