        axios.get("http://localhost:9087/customer/"+id , {'Authorization' : header})
            .then(response => {
                console.log(response.data)
            })
            .catch(err => {
                console.log('error')
                console.log(err)
            })
    }

    return(
        <>
            {getData}
        </>
    )
}
